import React from 'react';

const SideLinks = ({name, icon}) => {
    return (
        <li>
            <a href="#">
                <div className='inline-block'>
                    <div className='flex items-center hover:bg-dark-frame hover:text-blue-200'></div>
                </div>
            </a>
        </li>
    );
};

export default SideLinks;
